    "#Variables:\n",
    "\n",
    "#image_id - linked to Tiff's [training]\n",
    "#center_id - Hospital or Lab where clot was reported\n",
    "#patient_id - speaks for itself\n",
    "#image_num - if multiple images taken of the same clot. This is the sequence number [starting at 0]\n",
    "#label - if the clot's aetiology is known, and has been provided from medical analysis LAA = Large Artery Atherosclerosis and CE = Cardioembolic.\n",
    "\n",
    "#Lets look at the distributions.\n",
    "\n",
    "bar1 <- as.data.frame(table(train_meta$label))\n",
    "\n",
    "colnames(bar1) <- c(\"Aetiology\",\"Frequency\")\n",
    "\n",
    "bar2 <- as.data.frame(table(train_meta$center_id))\n",
    "\n",
    "colnames(bar2) <- c(\"Center_ID\", \"Frequency\")\n",
    "\n",
    "plot <- function(x){\n",
    "    ggplot(x, aes(x = x[,1], y = x[,2])) + \n",
    "    geom_bar(stat = \"identity\") +\n",
    "    xlab(colnames(x[1])) +\n",
    "    ylab(colnames(x[2]))\n",
    "    }\n",
    "\n",
    "plot(bar1)\n",
    "\n",
    "plot(bar2)"
   ]
  }
